Table S23
morphometric variation across all specimens combined. Dorsal profile steep: straight, convex, or slightly concave from tip of snout to occiput, slightly concave at occiput, convex or straight from occiput to dorsal fin origin, and convex behind dorsal fin origin to base of last dorsal ray, then horizontal to caudal fin base. Ventral profile slightly convex and downward angled on underside of head, convex from pelvic fin origin to below last dorsal fin ray, and horizontal to caudal fin base. Lateral line continuous from behind head to base of caudal fin, and approximately parallel with dorsal profile. Body depth at dorsal fin origin 38 (34.4–46.1) % SL; body depth at anal fin origin 32.9 (27.5–40.2) % SL; caudal peduncle length 16.5 (14.0–18.2) % SL; caudal peduncle depth 12.8 (11.4–14.4) % SL; pre-anus length 67.1 (63.6–70.1) % SL. Head length 31.5 (28.3–33.5) % SL; head pointed; snout length 39 (37.1–41.5) % HL; upper-jaw length 27.7 (22.7–31.0) % HL; jaws equal throughout development; jaw width 28.6 (25.4–31.7) % HL. Mouth terminal, horizontal or slightly angled upwards in lateral profile. Outer row of large teeth of same size with 3 (2–3) rows of smaller teeth on both jaws, embedded in a jelly-like gum. Teeth in outer row of upper jaw 56 (44–90) number varying with size, 4 (3.1–7.4) / mm when standardised with upper jaw length; teeth on outer row of lower jaw 62 (38–79), number varying with size, 5.6 / mm when standardised with upper jaw length; tooth size decreasing from outer row to inner rows. Teeth laterally compressed, broad and large, asymmetric shape, margins convex posteriorly and straight to slightly concave anteriorly, widest point closest to mid-point of tooth, apical region tapered to slight point, teeth fitted close together with some overlap (Tooth Morphotype 1; 
Fig. 6b
), laterally pointed in lower jaw, but not extending beyond outer lip. Toothless medial hump present on dorsal surface at symphysis of lower jaw, opposite toothless region of upper jaw in some specimens. Lower jaw U-shaped in juveniles and adults when viewed from below (Morphotype 1; 
Fig. 5a
). Upper jaw usually with fleshy, narrow, lip fold that is mostly discontinuous across the ventral midline, but occasionally continuous. Orbital diameter 23.3 (17.3–29.2) % HL; inter-orbital width 32.6 (28.9–35.9) % HL; post-orbital length 40.3 (36.6–44.8) % HL. Inter-orbital smooth, with bony ridge above each orbit. Parietal and supracleithrum sometimes serrated. Lower opercular spine longer and more robust than upper opercular spine, sometimes extend beyond edge of opercular membrane; preopercular spines serrate, longest and most robust on apex of preopercle, reduced in size dorsally and anteriorly, anteriormost spine situated behind posterior edge of orbit. Intestinal pattern of adults highly convoluted; large amount of looping to left of stomach; juveniles with less convoluted pattern.
